/**
 * Method Searches for Element in a Javascript Array
 * @param array Specifies Javascript Array to be searched
 * @param element Specifies the Element that is to be looked up
 * @return Returns the index of the element
 */

function searchArray(array, element){
    for(var i = array.length; i>=0 && array[i]!=element; i--);
    return i;
}

/**
 * @Description Method displays error and success messages
 * @Modified By Javidkhan
 * @Reason Bug 6086
 * @param elementid Specifies div tag where to display message
 * @param message Specifies message body 
 * @param type Specifies type of message
 */
function displayMessage(elementid, message, type){
 
	var messageTypes = type.split("#");
	var messageData = message.split("#");
	var tempType = "";
	var tempColor = "";
	var finalmsg = "";

	for(var i = 0; i < messageTypes.length && i < messageData.length; i++){
		if(messageData != "" || messageData != null){
			if (messageTypes[i].toLowerCase() == "info"){
				tempType = 'info';
				tempColor = 'green';
				finalmsg += '<table class=' + tempType + ' align="center" cellspacing="5" cellpadding="5" width="100%" >'
					+ '<tr align = "center" valign="center"><td></td><td align="center"width="100%"><FONT class="form" color=' + tempColor + '>'
					+ messageData[i] + '</font></td>'
            + '</tr></table>';
			}
			if (messageTypes[i].toLowerCase() == "error" || messageTypes[i] == null || messageTypes[i] == ""){
				tempType = 'error';
				tempColor = 'red';
				finalmsg += '<table class=' + tempType + ' align="center" cellspacing="5" cellpadding="5" width="100%" >'
					+ '<tr align = "center" valign="center"><td></td><td align="center"width="100%"><FONT class="form" color=' + tempColor + '>'
					+ messageData[i] + '</font></td>'
					+ '</tr></table>';
			}
		}else {
			finalmsg += '<table align="center" cellspacing="5" cellpadding="5" width="100%">'
            + '<tr align="center" valign="center"><td></td><td align="center"width="100%"></td>'
            + '</tr></table>';
    }
		document.getElementById(elementid).innerHTML = finalmsg;
    document.getElementById(elementid).style.display='';
}
}
/**
  For Hiding the error message displayed on the page for the id specified
*/
function hideErrorMessage(elementId){
	if(elementId != null){
		document.getElementById(elementId).style.display='none';
	}
}

function check_date(field){
    var checkstr = "0123456789";
    var DateField = field;
    var DateValue = "";
    var DateTemp = "";
    var separator = "";
    var day;
    var month;
    var year;
    var str;
    var leap = 0;
    var err = 0;
    var i;
    var result= false;
    err = 0;
    DateValue = DateField.value;
     
    if(DateField.value.length==0){
        return true;
    }
    if(DateValue.indexOf("-")!=-1){
        separator= "-";
    }
    if(DateValue.indexOf("/")!=-1){
        separator= "/"; 
    }
    if(DateValue.indexOf(".")!=-1){
        separator= ".";
    }

    /* Validate if date is greater that 1900 */
    var splitedDate = DateValue.split(separator);
    var isInvalidYear = false;
    for(var index=0; index < splitedDate.length; index++)
    {
            if(splitedDate[index].length == 4 && splitedDate[index] < 1900) 
            {    
                isInvalidYear = true;
            }
    }

    if(isInvalidYear== true){
      validationError= true;
      alert("Incorrect Date. Please provide a valid Date.");
      field.select();
      field.focus();
      return false;
   }

    //Handle separators with partial Date/Month fields
    if(separator!=""){
        index1= DateValue.indexOf(separator);
        index2= DateValue.lastIndexOf(separator);
        str = DateValue.substr(0,2);
        if((str==19)||(str==20)){
            year= DateValue.substring(0,index1);
            month= DateValue.substring(index1+1,index2);
            day= DateValue.substring(index2+1,DateValue.length);
        }else{
            month= DateValue.substring(0,index1);
            day= DateValue.substring(index1+1,index2);
            year= DateValue.substring(index2+1,DateValue.length);
        }
     
        if(month.length!=2){
            month= "0"+month;
        }
        if(day.length!=2){
            day= "0"+day;
        }
        
        DateValue= year+month+day;
    }
 

     
    /* Delete all chars except 0..9 */
   for (i = 0; i < DateValue.length; i++) {
      if (checkstr.indexOf(DateValue.substr(i,1)) >= 0) {
         DateTemp = DateTemp + DateValue.substr(i,1);
      }
   }
   if(DateTemp.length == 8){
       DateValue= DateTemp;
       str = DateValue.substr(0,2);
	   if(parseInt(str) > 12 ) { //added by vinod
       //if((str ==19)|| (str==20) || (str==21)){          //Format is YYYY,MM,DD
        year = DateValue.substr(0,4);
        /* Validation of month*/
         month = DateValue.substr(4,2);
         /* Validation of day*/
        day = DateValue.substr(6,7);
        }else{                              //Format is MM,DD,YYYY
          /* Validation of month*/
         month = DateValue.substr(0,2);
         /* Validation of day*/
         day = DateValue.substr(2,2);
         /* validation for year */
         year = DateValue.substr(4,7);
        }
		
			
       /* validation for month */
        if ((month >12)) {
            err = 21;
           }
       /* validation for Date */
        if ((day >31)) {
            err = 22;
        }
        /* Validate if date is greater that 1900 */
        if(year < 1900){
            err= 1900;
            
        }
       /* Validation leap-year / february / day */
       if ((year % 4 == 0) || (year % 100 == 0) || (year % 400 == 0)) {
          leap = 1;
       }
       if ((month == 2) && (leap == 1) && (day > 29)) {
          err = 23;
       }
       if ((month == 2) && (leap != 1) && (day > 28) ) {
          err = 24;
       }
       /* Validation of other months */
       if ((day > 31) && ((month == "01") || (month == "03") || (month == "05") || (month == "07") || (month == "08") || (month == "10") || (month == "12"))) {
          err = 25;
       }
       if ((day > 30) && ((month == "04") || (month == "06") || (month == "09") || (month == "11"))) {
          err = 26;
       }
       /* if 00 ist entered, no error, deleting the entry */
       if ((day == 0) && (month == 0) && (year == 00)) {
          err = 400; day = ""; month = ""; year = ""; seperator = "";
       }
       
       /* if 00 is entered for Month or Day or Year , no error, deleting the entry */
       if ((day == "00") || (month == "00") || (year == "000") || (year == "0000"))
       {
          err = 400; day = ""; month = ""; year = ""; seperator = "";
       }
       
       /* if no error, write the completed date to Input-Field (e.g. 13.12.2001) */
        separator= "/";
       if (err == 0) 
       {
          DateField.value = month + separator + day + separator + year;
          result= true;
       }       
       
       if (err == 400) 
       {  
          separator="";
          DateField.value = month + separator + day + separator + year;
          result= true;
       } 
       if (err == 1900) 
       {  
          result= false;
       }
   }
   else{
        result= false;
   }
   if(result== false){
      validationError= true;
      alert("Incorrect Date. Please provide a valid Date.");
      field.select();
      field.focus();
      return false;
   }else{
      return true; 
   }
    
}

function getFormattedName(lName,fName){
    var rName = '';
	 
	if(lName=='' && fName!=''){
		rName=fName;
	}else if(fName=='' && lName!=''){
		rName=lName;
	}else if(fName!='' && lName!=''){
		rName=lName+', '+fName;
	}	 
	return rName;
}


