function check_daterange(field){
    var DateField = field;
    var tempField = field.value;
    if(tempField == "") {
       return true;
    }
    if(tempField.length == 0){
      return true;
    }

    var DateValue = "";
    var result= false;
    var temp1, temp2;
    validationError= false;
    for(var i=0;i<field.value.length;i++){
        if(field.value.charAt(i)!=' '){
            DateValue+= field.value.charAt(i);
        }
    }
    field.value= DateValue;
	
    if (field.value!="" && !field.value.match(/^[0-9-\/.]+$/)){
        result= false;
    }else{
	
        if(DateValue.length > 16 && DateValue.length < 22){
            var index= -1;
            if(DateValue.indexOf("-") != -1) {
               index= DateValue.indexOf("-");
            }
            var date1= DateValue.substring(0,index);
            var date2= DateValue.substring(index+1, DateValue.length);
            DateField.value= date1;
            check_date_no_alert(DateField);
            date1= DateField.value;
            DateField.value= date2;
            date2= check_date_no_alert(DateField);
            if(date2 == true) {
              date2= DateField.value;
              temp1= date1.substring(6,10)+date1;
              temp2= date2.substring(6,10)+date2;
              if(temp1>temp2){
                var temp= date1;
                date1= date2;
                date2= temp;
              }
              DateField.value= date1+"-"+date2;
              result= true;
           } else{
             DateField.value = tempField;
           } 
        }
        else if(DateValue.length == 8 || DateValue.length == 10){//If Individual date is specified
		    check_date(field);
            result= true;
        } else {
           result = false;
        }
    }
    if(validationError==true){
      alert("Incorrect Date. Please provide a valid Date.");
      field.select();
      field.focus();
    }else if(result== false){
      alert("Incorrect Date. Please provide a valid Date.");
      field.select();
      field.focus();
   }
}


function validateAlphaNum(field){
    field.value = field.value.trim(); 
    if (field.value!="" && !field.value.match(/^[a-zA-Z0-9?*]+$/)){
        alert("Invalid Input. Please enter only Alpha-Numeric values.");
        field.select();
        field.focus();
    }
}

function validateAlpha(field)
{
    if (field.value!="" && !field.value.match(/^[a-zA-Z?*]+$/)){
        alert("Invalid Input. Please enter only Alphabetic values.");
        field.select();
        field.focus();
    }
}

function validateNumeric(field)
{   
    if (field.value!="" && !field.value.match(/^[0-9?*]+$/))
    {
        alert("Invalid Input. Please enter only Numeric values.");
        field.select();
        field.focus();
    }
}   

function validateNumericValue(fieldValue){
	return fieldValue!="" && fieldValue.match(/^[0-9?*]+$/);
}

function checkNumeric(x){
 // alert('Inside numeric');
    var value= x.value;
    var finalValue="";
    for(var i=0;i<value.length;i++){
        if(value.charAt(i)>="0" && value.charAt(i)<="9" ||  value.charAt(i)=="-" ){
            finalValue+= value.charAt(i);
        }
    }
    if(x.value!= finalValue){
        x.value= finalValue;
    }
}

function _checkCurrency(x){
	return x.match("^[-]{0,1}[0-9]*([.][0-9]{1,2}){0,1}$");
}

var isCurrency_re    = /^\s*(\+|-)?((\d+(\.\d\d)?)|(\.\d\d))\s*$/;
function isCurrency(field) {
	if (field.value!="" && !field.value.match(isCurrency_re))
    {
        alert("Invalid Input. Please enter only Decimal values.");
        field.select();
        field.focus();
    }
}

/**
 * Utility method to validate a currency field in the format of $ followed by one or more valid digits followed by decimal point, followed by exactly 2 digits.
 * Note - If all other things are valid, expect there is only 1 digit after decimal place, then this method will append '0' after it, so that it becomes valid currency.
 * @author Umesh Shete
 * @since Dec 28, 2014 (VOY-12605)
 */
function validateCurrencyField(field){
	if(field.value == ''){
		return true;
	}else if(new RegExp("^\\$[0-9]+\\.\\d{1}$").test(field.value)){
		field.value +='0';
		return true;
	}else if(new RegExp("^\\$[0-9]+\\.\\d{2}$").test(field.value)){
		return true;
	}else{
		alert("Invalid currency. Currency must be in the format $ followed by valid digits, a decimal point and two digits after decimal point.");
		field.select();
        field.focus();
		return false;
	}
}

/**
	Method sets the value of the currency field by removing the currency symbol (Expected to be the first character in it) from it,
	So that the DB field saves only the value, and not the currency character.
	Eg - If the original value is $123.45, sets it to 123.45
	Note - Sets the value only if the value of the field is > 0. Else, does nothing.
*/
function removeCurrencySymbolFromValue(currencyFieldId){
	var tempVal = $("#"+currencyFieldId).val();
	if(tempVal.length > 0){
		$("#"+currencyFieldId).val(tempVal.substring(1,tempVal.length));
	}
}

/** @author Arun 
 *  Description : This function accept three params 
 *                strBodyText : Input string 
 *                strSearchText: text to be searched
 *                strStringToReplace : test to be replaced with
 */


function replace(strBodyText,strSearchText,strStringToReplace) 
{
   
       
  var newText = "";
  var counter = -1;
  var lcSearchTerm;
  lcSearchTerm = strSearchText.toLowerCase();
  var lcBodyText;
  lcBodyText = strBodyText.toLowerCase();
   

  while (strBodyText.length > 0)
  {
     counter = lcBodyText.indexOf(lcSearchTerm, counter+1);
    
    if (counter < 0) 
    {
      newText += strBodyText;
      strBodyText = "";
    }
    else
    {
              newText += strBodyText.substring(0, counter) + strStringToReplace ;
              strBodyText = strBodyText.substr(counter + strSearchText.length);
              lcBodyText = strBodyText.toLowerCase();
              counter = -1;
    }
  }
  
  return newText;
}

/* Function to replace first ocurance of string  */
function replaceFirst(strBodyText,strSearchText,strStringToReplace) 
{
    var newText = "";
  var counter = -1;
  var lcSearchTerm;
  lcSearchTerm = strSearchText.toLowerCase();
  var lcBodyText;
  lcBodyText = strBodyText.toLowerCase();
   

  while (strBodyText.length > 0)
  {
     counter = lcBodyText.indexOf(lcSearchTerm, counter+1);
    
    if (counter < 0) 
    {
      newText += strBodyText;
      strBodyText = "";
    }
    else
    {
              newText += strBodyText.substring(0, counter) + strStringToReplace + strBodyText.substr(counter + strSearchText.length); ;
              strBodyText = "";
              lcBodyText = strBodyText.toLowerCase();
              counter = -1;
    }
  }
  
  return newText;
}


   function ltrim(argvalue) {
    
            while (1) {
               if (argvalue.substring(0, 1) != " ")
               break;
               argvalue = argvalue.substring(1, argvalue.length);
            }
        
          return argvalue;
       }
       
       
    function rtrim(argvalue) {
    
      while (1) {
          if (argvalue.substring(argvalue.length - 1, argvalue.length) != " ")
          break;
          argvalue = argvalue.substring(0, argvalue.length - 1);
      }
    
      return argvalue;
    }
      
      function trim(argvalue) {
          var tmpstr = ltrim(argvalue);
          return rtrim(tmpstr);
        }
        
