function validate_date(field){
    var checkstr = "0123456789";
    var DateField = field;
    var DateValue = "";
    var DateTemp = "";
    var separator = "";
    var day;
    var month;
    var year;
    var str;
    var leap = 0;
    var err = 0;
    var i;
    var result= false;
    err = 0;
    DateValue = DateField.value;
    if(DateField.value.length==0){
        return true;
    }
    if(DateValue.indexOf("-")!=-1){
        separator= "-";
    }
    if(DateValue.indexOf("/")!=-1){
        separator= "/";
    }
    if(DateValue.indexOf(".")!=-1){
        separator= ".";
    }
    //Handle separators with partial Date/Month fields
    if(separator!=""){
        index1= DateValue.indexOf(separator);
        index2= DateValue.lastIndexOf(separator);
        str = DateValue.substr(0,2);
        if((str==19)||(str==20)){
            year= DateValue.substring(0,index1);
            month= DateValue.substring(index1+1,index2);
            day= DateValue.substring(index2+1,DateValue.length);
        }else{
            month= DateValue.substring(0,index1);
            day= DateValue.substring(index1+1,index2);
            year= DateValue.substring(index2+1,DateValue.length);
        }
        if(month.length!=2){
            month= "0"+month;
        }
        if(day.length!=2){
            day= "0"+day;
        }
        DateValue= year+month+day;
    }


    /* Delete all chars except 0..9 */
   for (i = 0; i < DateValue.length; i++) {
      if (checkstr.indexOf(DateValue.substr(i,1)) >= 0) {
         DateTemp = DateTemp + DateValue.substr(i,1);
      }
   }
   
   if(DateTemp.length == 8){
       DateValue= DateTemp;
       str = DateValue.substr(0,2);
       if((str ==19)|| (str==20)){          //Format is YYYY,MM,DD
        year = DateValue.substr(0,4);
        /* Validation of month*/
         month = DateValue.substr(4,2);
         /* Validation of day*/
        day = DateValue.substr(6,7);
        }else{                              //Format is MM,DD,YYYY
          /* Validation of month*/
         month = DateValue.substr(0,2);
         /* Validation of day*/
         day = DateValue.substr(2,2);
         /* validation for year */
         year = DateValue.substr(4,7);
        }
       /* validation for month */
        if ((month >12)) {
            err = 21;
           }
       /* validation for Date */
        if ((day >31)) {
            err = 22;
        }
       /* Validation leap-year / february / day */
       if ((year % 4 == 0) || (year % 100 == 0) || (year % 400 == 0)) {
          leap = 1;
       }
       if ((month == 2) && (leap == 1) && (day > 29)) {
          err = 23;
       }
       if ((month == 2) && (leap != 1) && (day > 28)) {
          err = 24;
       }
       /* Validation of other months */
       if ((day > 31) && ((month == "01") || (month == "03") || (month == "05") || (month == "07") || (month == "08") || (month == "10") || (month == "12"))) {
          err = 25;
       }
       if ((day > 30) && ((month == "04") || (month == "06") || (month == "09") || (month == "11"))) {
          err = 26;
       }
       /* if 00 ist entered, no error, deleting the entry */
       if ((day == 0) && (month == 0) && (year == 00)) {
          err = 400; day = ""; month = ""; year = ""; seperator = "";
       }
       
       /* if 00 is entered for Month or Day or Year , no error, deleting the entry */
       if ((day == "00") || (month == "00") || (year == "000") || (year == "0000"))
       {
          err = 400; day = ""; month = ""; year = ""; seperator = "";
       }
       
       /* if no error, write the completed date to Input-Field (e.g. 13.12.2001) */
        separator= "/";
       if (err == 0) 
       {
          DateField.value = month + separator + day + separator + year;
          result= true;
       }       
       
       if (err == 400) 
       {  
          separator="";
          DateField.value = month + separator + day + separator + year;
          result= true;
       }
       
   }
   else{
        result= false;
   }
   if(result== false){
      return false;
   }else{
      return true; 
   }
    
}

/*
* Removes any Paranthesis encountered in the Value of a field
*/
function checkParanthesis(x){
        var value= x.value;
        var finalValue="";
        for(var i=0;i<value.length;i++){
            if(value.charAt(i)!="}" && value.charAt(i)!="{"){
                finalValue+= value.charAt(i);
            }
        }
        if(x.value!= finalValue){
            x.value= finalValue;
        }
}

/**
* Added by Namrata
* This function compares two date and uses '/' as seperator.
* if value1 < value2 its return -1
* if value1 > value2 its return 1
* if value1 == value 2 its return 0
*/

function compareDates (value1, value2) {
   var date1, date2;
   var month1, month2;
   var year1, year2;

   month1 = value1.substring (0, value1.indexOf ("/"));
   date1 = value1.substring (value1.indexOf ("/")+1, value1.lastIndexOf ("/"));
   year1 = value1.substring (value1.lastIndexOf ("/")+1, value1.length);

   month2 = value2.substring (0, value2.indexOf ("/"));
   date2 = value2.substring (value2.indexOf ("/")+1, value2.lastIndexOf ("/"));
   year2 = value2.substring (value2.lastIndexOf ("/")+1, value2.length);

   if (year1 > year2) return '1';
   else if (year1 < year2) return '-1';
   else if (month1 > month2) return '1';
   else if (month1 < month2) return '-1';
   else if (date1 > date2) return '1';
   else if (date1 < date2) return '-1';
   else return '0';
}

