function getAjaxRequest()
{
    var xmlHttp;
    try
    {
        // Firefox, Opera 8.0+, Safari  
        xmlHttp=new XMLHttpRequest();  
    }
    catch (e)
    {  // Internet Explorer  
        try
        {
            xmlHttp=new ActiveXObject("Msxml2.XMLHTTP");    
        }
        catch(e)
        {
            try
            {
                xmlHttp=new ActiveXObject("Microsoft.XMLHTTP");      
            }
            catch (e)
            {
                alert("Your browser does not support AJAX!");
                return false;
            }
        }
    }
    return xmlHttp;
}

/**
 * Method Adds a Row to the Table with the Specified ID. 
 * Assigns id for each row element as: tableId.<rowIndex>
 * Assigns id for each column element as: tableId.<rowIndex>.<columnIndex>
 * @param tableId Specifies the id attribute of the Table in which row needs to be added.
 * @param rowid Specifies the Row from the original table that should be used for adding the new row.
 * @return The index of the new Row Added
 */
function addRow(tableId, rowid){
    var newRow;
    var cell;
    var index= '';
    try{
        var table= document.getElementById(tableId);
        newRow= table.insertRow();
        index= newRow.rowIndex;
        newRow.id = tableId+'.'+index;
        for(var col=0; col< table.rows[rowid].cells.length; col++){
            cell= newRow.insertCell();
            cell.id= tableId+'.'+index+'.'+cell.cellIndex;
            cell.innerHTML = table.rows[rowid].cells[col].innerHTML;
        }
    }catch(e){
        //alert(e.message); /* Enable for Debug */
    }
    return index;
}

/**
 * Method Adds an Option to the specified Select control
 * @param selectId Specifies the id attribute of the Select control
 * @param optionValue Specifies the Value to be used for the Option element
 * @param optionText Specifies the Description (Display Text) to be used for the option
 */
function addOptions(selectControl, optionValue, optionText){
    var option = document.createElement("OPTION");
    try{
        selectControl.add(option, null);
    }catch(e){
        selectControl.add(option);
    }
    option.innerText = optionText;
    option.value = optionValue;
    option.text = optionText;
}

/**
 * Method Registers an Event for the specified Event on an Element 
 * @param element Specifies the Element for which the Event is required
 * @param event Specifies the Event that needs to be registered
 * @param handler Specifies the Event Handler
 * @return
 */
function addEvent(element, event, handler){
    element.attachEvent(event, handler);
}

/**
 * Method UnRegisters an Event Handler to the specified Event on the Element 
 * @param element Specifies the Element for which the Event is required
 * @param event Specifies the Event that needs to be registered
 * @param handler Specifies the Event Handler
 * @return
 */
function removeEvent(element, event, handler){
    element.detachEvent(event, handler);
}

/**
 * Opens a new Window centered in the screen
 * @param windowUri Specifies the URI for the new Window
 * @param windowName Specifies the Name for the new Window
 * @param windowWidth Specifies the desired Window Width in pixels or % e.g. 400, 40% 
 * @param windowHeight Specifies the desired Window Height in pixels or % e.g. 600, 60%
 * @param style Specifies the Toolbar, Statusbar, etc. options on the new Window (see window.open)
 * @return Name of the New Window
 */
function openWindow(windowUri, windowName, windowWidth, windowHeight, style){
   /**  
   *    Javascript error occures when new window opens a PDF document.
   *    Parent Window lost reference to child Window when PDF document is opened.
   *    To fix this issue, new window with blank url is opened first and closed immediately.  
   */
   try {
        newWindow = window.open("", windowName, 'top=5000, left=5000,height=1px,width=1px, toolbar=no, menubar=no, scrollbars=no, resizable=no,location=no, directories=no, status=no');
        newWindow.close();
    }
    catch(e)
    {} 

    if(windowWidth.indexOf('%')>=0){
        windowWidth= window.screen.width * new Number(windowWidth.replace("%","")) / 100;
    }
    if(windowHeight.indexOf('%')>=0){
        windowHeight= window.screen.height * new Number(windowHeight.replace("%","")) / 100;
    }
    
    var centerWidth = (window.screen.width - windowWidth)/2;
    var centerHeight = (window.screen.height - windowHeight)/2;
    newWindow = window.open(windowUri, windowName, style + 
        ',width=' + windowWidth + 
        ',height=' + windowHeight + 
        ',left=' + centerWidth + 
        ',top=' + centerHeight);

    if (window.focus)
    {
        newWindow.focus();
    }
    return newWindow;
}

/**
 * Method invokes a File-Upload dialog. The dialog is labeled 'title' and uploads to the 'location' specified.
 * @param title Specifies the Title of the Dialog box.
 * @param fLocation Specifies the location where the File should be uploaded. The location specified must be a property in VoyagerSystemProperties. 
 * @return
 */
function attachDocument(title, fLocation, entityId){
    try{
        var windowOpts= "location = no, menubar = no, status =no, toolbar = no, resizable = no, scrollbars = no";
        var uri = "attachDocument.htm?title="+title+"&location="+fLocation+"&entityId="+entityId;
        openWindow(uri, "UploadDocument", "33%", "13%", windowOpts);
    }catch(e){
        alert("Could not open dialog for attaching document. Popup-blocker may be preventing the same.");
    }
}

