/**
	To handle single wild card character. If there is single wild-card char. e.g (*) then it should throw an error.
*/
function checkProperWildCard(txtControl){
    var result = false;
    var reWildCard ="^[*]+$";
    if ((new RegExp(reWildCard, "i")).test(trim(txtControl.value))) {
        result = true;
    }
    else {
        result = false;     
    }
    
    return result;
}

