/**
 * Method sets the opacity of the specified field. Allowed values 1-10
 * @param element Specifies the element on which to set opacity.
 * @param value Specifies the opacity value.
 */
function setOpacity(element, value) {
	element.style.opacity = value/10;
	element.style.filter = 'alpha(opacity=' + value*10 + ')';
}

/**
 * Get the absolute x, y position of any element on a page.
 * @param e Specifies the element.
 * @return Object containing properties x, y containing left, top respectively.
 */
function getPosition(e){ 
	var left = 0; 
	var top  = 0; 
	while (e.offsetParent){ 
		left += e.offsetLeft; 
		top += e.offsetTop; 
		e = e.offsetParent; 
	} 
	left += e.offsetLeft; 
	top  += e.offsetTop; 
	return {x:left, y:top}; 
} 


