String.prototype.trim = function() { return this.replace(/^\s+|\s+$/g, ''); };

function StringBuilder(value)
{
    this.strings = new Array("");
    this.append(value);
}

// Appends the given value to the end of this instance.
StringBuilder.prototype.append = function (value)
{
    if (value)
    {
        this.strings.push(value);
    }
};

// Clears the string buffer
StringBuilder.prototype.clear = function ()
{
    this.strings.length = 1;
};

// Converts this instance to a String.
StringBuilder.prototype.toString = function ()
{
    return this.strings.join("");
};

/* Generates a Request Id by appending the timestamp to the URI
*/
function generateRequestId(requestType){
	var now = new Date();
	var x = now.getFullYear()+'_'+now.getMonth()+'_'+now.getDate()+'_'+now.getHours()+'_'+now.getMinutes()+'_'+now.getSeconds()+'_'+now.getMilliseconds();
	return requestType+'_'+x;
}

