					if(effecDate < maxDate)	{
						errorMsg = "Effective Date must be equal or greater than " + formatDatee(maxDate);
                        effectiveDate.select();
                        effectiveDate.focus();
					}
				}
				if(effecDate <  coverageEffectivedate){
						errorMsg = "PCP Effective Date should be equal or greater than " + formatDatee(coverageEffectivedate);
						effectiveDate.select();
						effectiveDate.focus();
				}
         }
    } 
	  return errorMsg;
} 

