/*
 * Parse the date.
 * Input date
 */
function parseDate(dateStr) {
    var mdy = dateStr.split('/');
    return new Date(mdy[2], mdy[0]-1, mdy[1]);
}
/*
 * Get date difference between first and second date.
 * Input first, second(Date) and return's no of days.
 */
function dayDiff(first, second) {
    return (second-first)/(1000*60*60*24);
}
/*
 * Get second date using provided date and dayRange.
 * Input firstDate, dayRange(no of days).
 * Returns second date.
 */
function autoDatePopulate(firstDate, dayRange){
	firstDate.setDate(firstDate.getDate()+dayRange);
	var month=(firstDate.getMonth()+1).toString();
	var day=(firstDate.getDate()).toString();
	var year=(firstDate.getYear()).toString();
	if(month.length==1){
		month="0"+month;
		}
	if(day.length==1){
		day="0"+day;
		}
	return month+"/"+day+"/"+year;
}	

/**
 * @Description Method displays error and success messages related to posted date
 * @author bandu.shinde
 * @Reason Bug 922
 * @param postedDate
 * @returns error message or result status
 */
function check_posted_date(field){
    var checkstr = "0123456789";
    var DateField = field;
    var DateValue = "";
    var DateTemp = "";
    var separator = "";
    var day;
    var month;
    var year;
    var str;
    var leap = 0;
    var err = 0;
    var i;
    var result= false;
    err = 0;
    DateValue = DateField.value;
    if(DateField.value.length==0){
        return true;
    }
    if(DateValue.indexOf("-")!=-1){
        separator= "-";
    }
    if(DateValue.indexOf("/")!=-1){
        separator= "/"; 
    }
    if(DateValue.indexOf(".")!=-1){
        separator= ".";
    }

    /* Validate if date is greater that 1900 */
    var splitedDate = DateValue.split(separator);
    var isInvalidYear = false;
    for(var index=0; index < splitedDate.length; index++)
    {
            if(splitedDate[index].length == 4 && splitedDate[index] < 1900) 
            {    
                isInvalidYear = true;
            }
    }

    if(isInvalidYear== true){
      validationError= true;
      alert("Incorrect Date. Please provide a valid Date.");
      field.select();
      field.focus();
      return false;
   }

    //Handle separators with partial Date/Month fields
    if(separator!=""){
        index1= DateValue.indexOf(separator);
        index2= DateValue.lastIndexOf(separator);
        str = DateValue.substr(0,2);
        if((str==19)||(str==20)){
            year= DateValue.substring(0,index1);
            /*If year less than four digit then adding 2000*/
			if(year.length < 4){
			year = 2000 + parseInt(year);
			}
            month= DateValue.substring(index1+1,index2);
            day= DateValue.substring(index2+1,DateValue.length);
        }else{
            month= DateValue.substring(0,index1);
            day= DateValue.substring(index1+1,index2);
            year= DateValue.substring(index2+1,DateValue.length);
            /*If year less than four digit then adding 2000*/
			if(year.length < 4){
			year = 2000 +parseInt(year);
			}
        }
  
        if(month.length!=2){
            month= "0"+month;
        }
        if(day.length!=2){
            day= "0"+day;
        }
        
        DateValue= year+month+day;
    }
     
    /* Delete all chars except 0..9 */
   for (i = 0; i < DateValue.length; i++) {
      if (checkstr.indexOf(DateValue.substr(i,1)) >= 0) {
         DateTemp = DateTemp + DateValue.substr(i,1);
      }
   }
   if(DateTemp.length == 8 || DateTemp.length == 7 || DateTemp.length == 6 || DateTemp.length == 5){
       DateValue= DateTemp;
       str = DateValue.substr(0,2);
	   if(parseInt(str) > 12 ) {          //Format is YYYY,MM,DD
       //if((str ==19)|| (str==20) || (str==21)){        
		year = DateValue.substr(0,4);
		month = DateValue.substr(4,2);
        day = DateValue.substr(6,7);
        }else{                          //Format is MM,DD,YYYY
		 /* Validation of month*/
         month = DateValue.substr(0,2);
         /* Validation of day*/
         day = DateValue.substr(2,2);
         /* validation for year */
         year = DateValue.substr(4,7);
         /*If year less than four digit then adding 2000*/
		 if(year.length < 4){
			year = 2000 + parseInt(year);
		 }
        }
		
			
       /* validation for month */
        if ((month >12)) {
            err = 21;
           }
       /* validation for Date */
        if ((day >31)) {
            err = 22;
        }
        /* Validate if date is greater that 1900 */
        if(year < 1900){
            err= 1900;
            
        }
       /* Validation leap-year / february / day */
       if ((year % 4 == 0) || (year % 100 == 0) || (year % 400 == 0)) {
          leap = 1;
       }
       if ((month == 2) && (leap == 1) && (day > 29)) {
          err = 23;
       }
       if ((month == 2) && (leap != 1) && (day > 28) ) {
          err = 24;
       }
       /* Validation of other months */
       if ((day > 31) && ((month == "01") || (month == "03") || (month == "05") || (month == "07") || (month == "08") || (month == "10") || (month == "12"))) {
          err = 25;
       }
       if ((day > 30) && ((month == "04") || (month == "06") || (month == "09") || (month == "11"))) {
          err = 26;
       }
       /* if 00 ist entered, no error, deleting the entry */
       if ((day == 0) && (month == 0) && (year == 00)) {
          err = 400; day = ""; month = ""; year = ""; seperator = "";
       }
       
       /* if 00 is entered for Month or Day or Year , no error, deleting the entry */
       if ((day == "00") || (month == "00") || (year == "000") || (year == "0000"))
       {
          err = 400; day = ""; month = ""; year = ""; seperator = "";
       }
       
       /* if no error, write the completed date to Input-Field (e.g. 13.12.2001) */
        separator= "/";
       if (err == 0) 
       {
          DateField.value = month + separator + day + separator + year;
          result= true;
       }       
       
       if (err == 400) 
       {  
          separator="";
          DateField.value = month + separator + day + separator + year;
          result= true;
       } 
       if (err == 1900) 
       {  
          result= false;
       }
   }
   else{
        result= false;
   }
   if(result== false){
      validationError= true;
      alert("Incorrect Date. Please provide a valid Date.");
      field.select();
      field.focus();
      return false;
   }else{
      return true; 
   }
    
}

/* Returns the complete Date object from the value specified */
function getMonthDayYear(field){
	var DateValue = field.value;	
	var separator = "";
	if(DateValue.indexOf("-")!=-1){
		separator= "-";
	}
	if(DateValue.indexOf("/")!=-1){
		separator= "/";
	}
	if(DateValue.indexOf(".")!=-1){
		separator= ".";
	}
	if(separator!=""){
		index1= DateValue.indexOf(separator);
		index2= DateValue.lastIndexOf(separator);
		str = DateValue.substr(0,2);
		if((str==19)||(str==20)){
			year= DateValue.substring(0,index1);
			month= DateValue.substring(index1+1,index2)-1;
			day= DateValue.substring(index2+1,DateValue.length);
		}else{
			month= DateValue.substring(0,index1)-1;
			day= DateValue.substring(index1+1,index2);
			year= DateValue.substring(index2+1,DateValue.length);
		}		
		return new Date(year, month, day);
	}
}

/**
 * Method Description: This method will restrict the combination of wildcharacter(*,?) with comma(,).
 * Intended use : Used for Member search by MemberId.
 * @param fieldValue
 * @return true or false
 * @author <a href="mailto:anupj@harbingergroup.com">Anup Junagade</a>
 * VOY - 2750
 * @since July 05, 2011
 * Modified on 14-Feb-2012 by AnupJ for VOY-5775(Check comma separated Numeric values)
 * Modified on 22-Mar-2012 by KunalK for VOY-6538(Member Search - Member ID will not allow entry of core member ID)
 */

function isCommaAndWildCharTogether(field){ 
	if ( ltrim(rtrim(field.value))!="" ){
		if(!(field.value.match(/^[a-zA-Z0-9 _]+(,[a-zA-Z0-9 _]+)*$/) || field.value.match(/^[a-zA-Z0-9 _*?]+$/))){
					alert("Invalid Input. Please enter only Comma Separated values(CSV) or only wild-character values(*,?).");
					field.select();
					field.focus();
		 }
	 }
}

/**
 * Method Description: Determines whether the given date is the last date of the month.
 * @param endDateField the HTML field, whose value has to be checked to be equal to the last date of the month.
 * @author <a href="mailto:sheteumesh@harbingergroup.com">Umesh Shete</a>
 * @returns true if the given date is the last date of the month, false otherwise.
 * @since March 29, 2012 (VOY-3083)
 */
function isLastDateOfMonth(endDateField){
	if(check_date(endDateField)){
	   var endDate = endDateField.value;
	   if(endDate != ''){
			var dateEnd = new Date(endDate.substring(6,10), endDate.substring(0,2)-1, endDate.substring(3,5));
			var monthDays = new Array(31, 28, 31, 30, 31, 30, 31, 31, 30, 31, 30, 31);
			var year = dateEnd.getFullYear();
			monthDays[1] = ((year % 4 == 0 && year % 100 != 0) || (year % 400 == 0))? 29 : 28;
			if(dateEnd.getDate() != monthDays[dateEnd.getMonth()]){
				alert("End date must be the last calendar date of a month.");
				endDateField.select();
				endDateField.focus();
				return false;
			  }
			}
	
	}
}

function openNewPopUpWindow(windowUri, windowName, windowWidth, windowHeight, style){

    if(windowWidth.indexOf('%')>=0){
        windowWidth= window.screen.width * new Number(windowWidth.replace("%","")) / 100;
    }
    if(windowHeight.indexOf('%')>=0){
        windowHeight= window.screen.height * new Number(windowHeight.replace("%","")) / 100;
    }
    
    var centerWidth = (window.screen.width - windowWidth)/2;
    var centerHeight = (window.screen.height - windowHeight)/2;
    newWindow = window.open(windowUri, generateRequestId("windowName"), style + 
        ',width=' + windowWidth + 
        ',height=' + windowHeight + 
        ',left=' + centerWidth + 
        ',top=' + centerHeight,true);

    if (window.focus)
    {
        newWindow.focus();
    }
    return newWindow;
}

