/**
 * Method Description: clears all the fields (barring hidden ones) of the given form.
 * @returns
 */
function clearForm(formName) {
    var x, y, z, type = null;
    for (x = 0; x < document.forms.length; x++) {
    	if(document.forms[x].id == formName){
	    	for (y = 0; y < document.forms[x].elements.length; y++) {
	            type = document.forms[x].elements[y].type.toLowerCase();		            
	            switch (type) {
	            case 'text':
	            case 'textarea':
	            case 'password':
					document.forms[x].elements[y].value = '';
					break;
	            case "hidden":
	                break;
	            case 'radio':
	            case 'checkbox':
	                document.forms[x].elements[y].checked = '';
	                break;
	            case 'select-one':
	                document.forms[x].elements[y].options[0].selected = "-2";
	                break;
	            case 'select-multiple':
	                for (z = 0; z < document.forms[x].elements[y].options.length; z++) {
	                    document.forms[x].elements[y].options[z].selected = false;
	                }
	                break;
	            }
	        }
    	}
    }
}

/**
 * Returns the last day of the month (which is also equal to the number of days in the month), for the given date string, passed in MM/dd/YYYY format.
 * @param strDate
 * @returns
 */
function getLastDateOfMonth(strDate){
	var dateObj = new Date(strDate.substring(6,10), strDate.substring(0,2)-1, strDate.substring(3,5));
	var monthDays = new Array(31, 28, 31, 30, 31, 30, 31, 31, 30, 31, 30, 31);
	var year = dateObj.getFullYear();
	monthDays[1] = ((year % 4 == 0 && year % 100 != 0) || (year % 400 == 0))? 29 : 28;
	return monthDays[dateObj.getMonth()];
}

